import { Route, Routes } from "react-router-dom";
import SecondPage from "./SecondPage";
import ProductPageCategory from "./Product page category/ProductPageCategory";
import { Categories, ProductsPage, } from '../../Data/data'
import { useState } from "react";
import { Categoryappear } from '../redux/actions/ReduxActions'
import { useDispatch, useSelector } from "react-redux";
// import { reducer } from "../redux/reducers/Redux";

const Mmnnnn = () => {

    const appearCategory = useSelector((state) => state.array1)
    const dispatch = useDispatch()


    return (
        <div>
            {/* <BrowserRouter> */}
            <Routes>
                <Route path='groceries' element={<SecondPage ProductsPage={ProductsPage.Supermarket} Categoties={() => Categoryappear(Categories.supermarket)} Cat={appearCategory} />} />
                <Route path='fashion' element={<SecondPage ProductsPage={ProductsPage.Fashion} Categoties={() => dispatch(Categoryappear(Categories.Fashion))} Cat={appearCategory} />} />
                <Route path='health-beauty' element={<SecondPage ProductsPage={ProductsPage.HealthBeauty} Categoties={() => dispatch(Categoryappear(Categories.HealthBeauty))} Cat={appearCategory} />} />
                <Route path='baby-products' element={<SecondPage ProductsPage={ProductsPage.BabyProducts} />} />
                <Route path='phones-tablets' element={<SecondPage ProductsPage={ProductsPage.PhoneTablets} />} />


                <Route path="/food-storage" element={<ProductPageCategory productPageCat={ProductsPage.Supermarket[0].Food_storage_Foil} />} />
                <Route path="/disposable-plates-cutlery" element={<ProductPageCategory productPageCat={ProductsPage.Supermarket[1].Disposable_Plates_Cutlery} />} />
                <Route path="/disposable-cups" element={<ProductPageCategory productPageCat={ProductsPage.Supermarket[2].Disposable_Cups} />} />
                {/* <Route path="/trash-compost-lawn-bags" element={<ProductPageCategory productPageCat={ProductsPage.Supermarket[3].Food_storage_Foil} />} /> */}
                <Route path="/detergent" element={<ProductPageCategory productPageCat={ProductsPage.Supermarket[3].Detergent} />} />
                {/* <Route path="/fabric-softner" element={<ProductPageCategory />} /> */}
                <Route path="/stain-removal" element={<ProductPageCategory productPageCat={ProductsPage.Supermarket[4].Stain_Removal} />} />
                <Route path="/air-fresheners" element={<ProductPageCategory productPageCat={ProductsPage.Supermarket[5].Air_Fresheners} />} />
                <Route path="/dishwashing" element={<ProductPageCategory productPageCat={ProductsPage.Supermarket[6].Dishwashing} />} />
                <Route path="/Kitchen Cleaners" element={<ProductPageCategory productPageCat={ProductsPage.Supermarket[7].Kitchen_Cleaners} />} />
                {/* <Route path="/Bathroom Cleaners" element={<ProductPageCategory />} /> */}

                <Route path="/womens-bags" element={<ProductPageCategory />} />
                <Route path="/dresses-jumpsuits" element={<ProductPageCategory />} />
                <Route path="/hoodies-sweatshirts" element={<ProductPageCategory />} />
                <Route path="/mens-casual-shirts" element={<ProductPageCategory />} />
                <Route path="/t-shirts-and-polos" element={<ProductPageCategory />} />
                <Route path="/men-suits" element={<ProductPageCategory />} />
                <Route path="/baby-boys-fashion" element={<ProductPageCategory />} />
                <Route path="/baby-girl-fashion" element={<ProductPageCategory />} />

                <Route path="/oral-care" element={<ProductPageCategory />} />
                <Route path="/feminine-hygiene" element={<ProductPageCategory />} />
                <Route path="/shave-hair" element={<ProductPageCategory />} />
                <Route path="/body-skin-care" element={<ProductPageCategory />} />
                <Route path="/eyes-treament-products" element={<ProductPageCategory />} />
                <Route path="/facial-care-cleansers" element={<ProductPageCategory />} />
                <Route path="/styling-tools" element={<ProductPageCategory />} />
                <Route path="/styling-products" element={<ProductPageCategory />} />
                <Route path="/shampoo-conditioner" element={<ProductPageCategory />} />
                <Route path="/wellness-relaxation" element={<ProductPageCategory />} />
                <Route path="/medical-supplies-equipment" element={<ProductPageCategory />} />
            </Routes>
            {/* </BrowserRouter> */}
        </div>
    )
}
export default Mmnnnn;
